// Home.js

import React from "react";
import { Outlet, Link } from "react-router-dom";
import './Home.css';

const Home = () => {
    return (
        <>
            <header>
                <nav>
                    <Link to="/Home" title="Home">Home</Link>
                    <div className="dropdown">
                        <Link to="/Student" className="dropbtn" title="Student">Student</Link>
                        <div className="dropdown-content">
                            <Link to="/StudentSignIn">Sign In</Link>
                            <Link to="/StudentSignUp">Sign Up</Link>
                        </div>
                    </div>
                    <div className="dropdown">
                        <Link to="/LandlordLogin" className="dropbtn">Landlord</Link>
                        <div className="dropdown-content">
                            <Link to="/LandlordLogin">Sign In</Link>
                            <Link to="/LandlordSignup">Sign Up</Link>
                        </div>
                    </div>
                    <Link to="/WardenLogin" title="Warden">Warden</Link>
                    <Link to="/AdminLogin" title="Admin">Admin</Link>
                </nav>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
